import TypingCustom from '../components/TypingCustom'

const Index = () => (
    <div className='grid'>
        <div className='left'>
            <p>
                Hello there.
            </p>
        </div>
        <div className='right'>
            <p>
                How are you?
            </p>
        </div>
        <style jsx>{`
        .header {
            font-size: 40px;
            font-weight: 700;
            line-height: 1.2;
            color: #486491;
            margin: 20px auto;
            font-family: 'Arial';
        }
        .grid {
            display: grid;
            grid-template-columns:70% 30%;
        }
        .left {
            background: #B4C1CC;
        }
        .right {
            background: #CAD6E1;
        }
      `}</style>
    </div>

);

export default Index;
